import React from "react";
function Social(){
    return(
    <ul className='list-group form-check'>
        <li  className='list-group-item'>
            <input type='checkbox' id='facebook' />
            <label for='facebook'>faceBook </label></li>

        <li className='list-group-item'>
        <input type='checkbox' id='youtube' />
        <label for='youtube'>youtube</label></li>
        <li className='list-group-item'>Instagram</li>
    </ul>

    );
}
export default Social;
